INSERT INTO `m_club` (`club_id`, `club_name`, `club_code`, `logo_url`, `carousel_images`, `pc_banner_url`, `business_start_time`, `business_end_time`, `address`, `phone`, `description`, `honor_info`, `booking_notice`, `province`, `city`, `district`, `business_license_url`, `contact_person`, `contact_phone`, `email`, `create_by`, `create_time`, `update_by`, `update_time`, `is_valid`, `is_delete`) VALUES (1, '示例马术俱乐部', 'DEMO_CLUB_001', 'http://192.168.0.100:61812/upload/public/common/fe90806728ed4503a722c8305ab9f4e3_20250803114758.jpg', 'http://192.168.0.100:61812/upload/public/common/b544c5d90ffd41fcb1bbde3562db88b2_20250803114724.png', NULL, '09:02:00', '18:01:00', '北京市朝阳区示例街道123号', '010-12345678', '这是一个示例马术俱乐部，提供专业的马术培训服务。', '获得多项马术比赛奖项', '请提前预约课程，按时到达。', '北京市', '北京市', '朝阳区', 'http://192.168.0.100:61812/upload/public/common/80ef1807e88244038f71d186538502be_20250803114738.png', '李四', '13800138000', 'demo@club.com', 'admin', '2025-08-03 02:24:05', 'admin', '2025-08-03 11:48:20', 1, 0);
INSERT INTO `m_club` (`club_id`, `club_name`, `club_code`, `logo_url`, `carousel_images`, `pc_banner_url`, `business_start_time`, `business_end_time`, `address`, `phone`, `description`, `honor_info`, `booking_notice`, `province`, `city`, `district`, `business_license_url`, `contact_person`, `contact_phone`, `email`, `create_by`, `create_time`, `update_by`, `update_time`, `is_valid`, `is_delete`) VALUES (2, '北京阳光马术俱乐部', 'BJY001', 'http://192.168.0.108:61812/upload/public/common/4e5e8327a3b64ef290b1590a8dc338b9_20250804223032.png', '[\"http://192.168.0.108:61812/upload/public/common/abac467875e345eea05e44467c7876e4_20250804223026.png\",\"http://192.168.0.108:61812/upload/public/common/c1e60f48812a476e82bb7e8a7894fb0a_20250804223830.jpg\",\"http://192.168.0.108:61812/upload/public/common/bc1cabc4431545a88af7892b5378a9e9_20250804223843.png\"]', 'https://example.com/pc_banner/bjy_pc_banner.jpg', '08:00:00', '20:00:00', '北京市朝阳区朝阳公园南路88号', '010-85961234', '北京阳光马术俱乐部成立于2010年，占地面积150亩，拥有标准化室内外马场、专业马匹和资深教练团队。我们致力于为会员提供安全、专业、舒适的马术体验，是北京地区知名的高端马术俱乐部。', '2019年获得\"北京市优秀马术俱乐部\"荣誉称号；2020年承办北京青少年马术锦标赛；2021年荣获\"中国马术协会优秀会员单位\"；多名学员在全国马术比赛中获得优异成绩。', '1. 请提前24小时预约课程；2. 上课请穿长裤和有跟靴子；3. 未满18岁学员需家长陪同；4. 请遵守俱乐部安全规定；5. 如需取消课程请提前12小时通知。', '北京市', '北京市', '朝阳区', 'https://example.com/license/bjy_license.jpg', '李经理', '13800138001', 'contact@bjyeq.com', 'admin', '2025-08-03 13:07:22', 'admin', '2025-08-04 22:42:52', 1, 0);
INSERT INTO `m_club` (`club_id`, `club_name`, `club_code`, `logo_url`, `carousel_images`, `pc_banner_url`, `business_start_time`, `business_end_time`, `address`, `phone`, `description`, `honor_info`, `booking_notice`, `province`, `city`, `district`, `business_license_url`, `contact_person`, `contact_phone`, `email`, `create_by`, `create_time`, `update_by`, `update_time`, `is_valid`, `is_delete`) VALUES (3, '上海国际马术中心', 'SHGJ002', 'https://example.com/logo/shgj_logo.jpg', 'https://example.com/banner/shgj_banner.jpg', 'https://example.com/pc_banner/shgj_pc_banner.jpg', '07:30:00', '21:00:00', '上海市浦东新区金桥路1888号', '021-58741234', '上海国际马术中心是华东地区规模最大的综合性马术俱乐部，拥有国际标准室内马场2个、户外马场3个，引进优质欧洲马匹60余匹。中心设有专业的马术学校、会员休闲区和马匹寄养服务。', '2018年成功举办上海国际马术公开赛；2019年被评为\"上海市体育产业示范单位\"；2020年获得国际马联FEI场地认证；2021年培养出全国青少年马术冠军3名。', '1. 会员可提前7天预约课程；2. 初学者必须参加安全培训；3. 马场内禁止大声喧哗；4. 请爱护马匹和设施；5. 雨天室外课程自动转入室内。', '上海市', '上海市', '浦东新区', 'https://example.com/license/shgj_license.jpg', '陈主任', '13900139002', 'info@shiec.com', 'admin', '2025-08-03 13:07:22', 'admin', '2025-08-03 13:07:22', 1, 0);
INSERT INTO `m_club` (`club_id`, `club_name`, `club_code`, `logo_url`, `carousel_images`, `pc_banner_url`, `business_start_time`, `business_end_time`, `address`, `phone`, `description`, `honor_info`, `booking_notice`, `province`, `city`, `district`, `business_license_url`, `contact_person`, `contact_phone`, `email`, `create_by`, `create_time`, `update_by`, `update_time`, `is_valid`, `is_delete`) VALUES (4, '广州骏马马术俱乐部', 'GZJM003', 'https://example.com/logo/gzjm_logo.jpg', 'https://example.com/banner/gzjm_banner.jpg', 'https://example.com/pc_banner/gzjm_pc_banner.jpg', '08:30:00', '19:30:00', '广州市天河区龙洞森林公园内', '020-87456789', '广州骏马马术俱乐部坐落在风景秀丽的龙洞森林公园内，环境优美，空气清新。俱乐部拥有专业的场地障碍训练场、盛装舞步训练场，以及完善的马匹护理设施，是华南地区马术爱好者的理想选择。', '2017年承办广东省马术锦标赛；2019年被评为\"广州市优秀体育俱乐部\"；2020年获得\"全国马术俱乐部安全管理先进单位\"；连续三年被评为\"会员满意度五星俱乐部\"。', '1. 请着合适的骑乘服装；2. 课程开始前30分钟到达；3. 听从教练指导，注意安全；4. 爱护环境，保持马场清洁；5. 如遇恶劣天气课程可能取消。', '广东省', '广州市', '天河区', 'https://example.com/license/gzjm_license.jpg', '王教练', '13700137003', 'service@gzjm.com', 'admin', '2025-08-03 13:07:22', 'admin', '2025-08-03 13:07:22', 1, 0);
INSERT INTO `m_club` (`club_id`, `club_name`, `club_code`, `logo_url`, `carousel_images`, `pc_banner_url`, `business_start_time`, `business_end_time`, `address`, `phone`, `description`, `honor_info`, `booking_notice`, `province`, `city`, `district`, `business_license_url`, `contact_person`, `contact_phone`, `email`, `create_by`, `create_time`, `update_by`, `update_time`, `is_valid`, `is_delete`) VALUES (5, '成都蜀山马术庄园', 'CDSS004', 'https://example.com/logo/cdss_logo.jpg', 'https://example.com/banner/cdss_banner.jpg', 'https://example.com/pc_banner/cdss_pc_banner.jpg', '09:00:00', '18:00:00', '成都市双流区蛟龙港天府大道南段2588号', '028-85123456', '成都蜀山马术庄园是一家集马术运动、休闲娱乐、商务会议于一体的综合性马术庄园。庄园占地200亩，拥有优美的自然环境和完善的配套设施，致力于推广马术文化，让更多人体验马术的魅力。', '2018年获得\"四川省马术协会优秀会员单位\"；2019年成功举办西南地区青少年马术夏令营；2020年被评为\"成都市体育旅游示范基地\"；培养了多名优秀马术人才。', '1. 庄园实行会员制管理；2. 请提前预约并准时到达；3. 严格遵守安全操作规程；4. 保护庄园环境，禁止随意采摘；5. 课程费用请按时结算。', '四川省', '成都市', '双流区', 'https://example.com/license/cdss_license.jpg', '孙经理', '13600136004', 'contact@cdss.com', 'admin', '2025-08-03 13:07:22', 'admin', '2025-08-03 13:07:22', 1, 0);
INSERT INTO `m_club` (`club_id`, `club_name`, `club_code`, `logo_url`, `carousel_images`, `pc_banner_url`, `business_start_time`, `business_end_time`, `address`, `phone`, `description`, `honor_info`, `booking_notice`, `province`, `city`, `district`, `business_license_url`, `contact_person`, `contact_phone`, `email`, `create_by`, `create_time`, `update_by`, `update_time`, `is_valid`, `is_delete`) VALUES (6, '杭州西湖马术会所', 'HZXH005', 'https://example.com/logo/hzxh_logo.jpg', 'https://example.com/banner/hzxh_banner.jpg', 'https://example.com/pc_banner/hzxh_pc_banner.jpg', '08:00:00', '20:00:00', '杭州市西湖区三墩镇西园路128号', '0571-88888888', '杭州西湖马术会所位于风景如画的西湖区，是一家高端精品马术俱乐部。会所秉承\"优雅、专业、安全\"的服务理念，为会员提供个性化的马术服务，包括专业教学、马匹寄养、马术比赛等。', '2019年承办浙江省马术公开赛；2020年获得\"杭州市优秀民营体育企业\"称号；2021年被评为\"中国马术协会认证俱乐部\"；会员在各类比赛中屡获佳绩。', '1. 会所采用预约制服务；2. 请着专业骑乘装备；3. 严格遵守会所各项规章制度；4. 尊重教练和工作人员；5. 维护会所优雅环境。', '浙江省', '杭州市', '西湖区', 'https://example.com/license/hzxh_license.jpg', '周会长', '13500135005', 'vip@hzxh.com', 'admin', '2025-08-03 13:07:22', 'admin', '2025-08-03 13:07:22', 1, 0);
INSERT INTO `m_club` (`club_id`, `club_name`, `club_code`, `logo_url`, `carousel_images`, `pc_banner_url`, `business_start_time`, `business_end_time`, `address`, `phone`, `description`, `honor_info`, `booking_notice`, `province`, `city`, `district`, `business_license_url`, `contact_person`, `contact_phone`, `email`, `create_by`, `create_time`, `update_by`, `update_time`, `is_valid`, `is_delete`) VALUES (7, '深圳湾马术俱乐部', 'SZVW006', 'https://example.com/logo/szvw_logo.jpg', 'https://example.com/banner/szvw_banner.jpg', 'https://example.com/pc_banner/szvw_pc_banner.jpg', '07:00:00', '21:30:00', '深圳市南山区深圳湾体育中心马术场', '0755-26888888', '深圳湾马术俱乐部位于深圳湾体育中心内，是深圳市首家国际标准马术俱乐部。俱乐部拥有现代化的马术设施和专业的服务团队，致力于为粤港澳大湾区的马术爱好者提供世界级的马术体验。', '2020年获得国际马联（FEI）认证；2021年成功举办粤港澳大湾区马术邀请赛；多次被评为\"深圳市体育产业优秀企业\"；培养了华南地区首批国家级马术裁判员。', '1. 俱乐部实行国际化管理标准；2. 所有课程需提前48小时预约；3. 请佩戴专业防护装备；4. 遵守国际马术礼仪；5. 保持环境整洁，共创和谐氛围。', '广东省', '深圳市', '南山区', 'https://example.com/license/szvw_license.jpg', '林总监', '13400134006', 'info@szwec.com', 'admin', '2025-08-03 13:07:22', 'admin', '2025-08-03 13:07:22', 1, 0);
